html = [==[
<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta name="description" content="Coverage report generated by Laura software">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta name="author" content="Laura">
    <link rel="shortcut icon"
      href="data:image/x-icon;base64,">
    <title>Laura Coverage Report</title>
    <style>
      :root {
        font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;

        --color-background: 255, 255, 255;
        --color-primary: 0, 0, 0;
        --color-secondary: 174, 174, 174;
        --color-accent: 43, 114, 123;
        --color-success: 0, 136, 21;
        --color-error: 238, 47, 74;
        --color-warning: 219, 165, 22;
        --color-alpha: 0.025;
        scroll-behavior: smooth;
      }


      @media (prefers-color-scheme: dark) {
        :root {
          --color-background: 15, 15, 17;
          --color-primary: 251, 251, 251;
          --color-secondary: 102, 102, 102;
          --color-accent: 43, 114, 123;
          --color-success: 46, 201, 70;
          --color-warning: 255, 186, 0;
        }
      }

      body,
      html {
        height: 100dvh;
      }

      body {
        background-color: rgb(var(--color-background));
        margin: 1rem 2rem;
        color: rgb(var(--color-primary));
        display: flex;
        flex-direction: column;
      }

      header {
        display: grid;
        grid-template-columns: auto 1fr;
        align-items: center;
        column-gap: 3rem;
        margin-bottom: 3rem;

        img {
          width: 100%;
          height: auto;
          image-rendering: pixelated;
        }
      }

      @media (max-width: 767px) {
        header {
          grid-template-columns: 1fr;
        }
      }

      h1,
      h2,
      h3 {
        font-weight: 400;
      }

      .covered {
        color: rgb(var(--color-success));
      }

      .not-covered {
        color: rgb(var(--color-error));
      }

      .partially-covered {
        color: rgb(var(--color-warning));
      }

      .excluded {
        color: rgb(var(--color-secondary));
      }

      summary {
        margin: 0 0 0.125rem;
        cursor: pointer;
        display: flex;
        justify-content: space-between;
        padding: .75rem 1rem;
        border-inline-start: 0.1875rem solid currentColor;

        &:hover {
          text-decoration: underline;
          filter: brightness(1.5);
        }

        &.covered {
          background-color: rgba(var(--color-success), var(--color-alpha));
        }

        &.not-covered {
          background-color: rgba(var(--color-error), var(--color-alpha));
        }

        &.partially-covered {
          background-color: rgba(var(--color-warning), var(--color-alpha));
        }
      }

      a:link,
      a:active,
      a:visited {
        color: rgb(var(--color-accent));
      }

      a:hover {
        filter: brightness(1.5);
      }

      .listing {
        font-family: 'Courier New', Courier, monospace;

        li {
          code {
            display: flex;
            justify-content: space-between;
            font-size: 1rem;
            margin: 0.125rem 0;
            white-space: pre;
            tab-size: 4;

            span:empty::before {
              content: ' ';
            }
          }

          &:hover {
            background-color: rgba(var(--color-secondary), calc(var(--color-alpha) * 3));
          }

          &.not-covered .hits,
          &.excluded .hits {
            display: none;
          }

          .hits {
            display: inline-block;
            min-width: 2ch;
            text-align: end;
          }
        }
      }

      .toggle-all {
        color: rgb(var(--color-accent));
        display: flex;
        justify-content: flex-end;
        margin: 1rem 0;
        cursor: pointer;

        span {
          display: inline-block;
          text-decoration: underline dashed;

          &:hover {
            filter: brightness(1.5);
          }
        }

        input {
          border: 0;
          clip: rect(0 0 0 0);
          height: auto;
          margin: 0;
          overflow: hidden;
          padding: 0;
          position: absolute;
          white-space: nowrap;
          width: 1px;
        }
      }

      footer {
        margin: auto 0 0;
        text-align: center;

        p {
          margin: 1rem;
        }
      }
    </style>
    <script type="module">
      const toggler = document.getElementById('toggle-button');
      const label = document.getElementById('toggle-label');
      const details = document.querySelectorAll("details");
      const summaries = document.querySelectorAll("summary");
      toggler.addEventListener('change', (e) => {
        details.forEach((elem) => (elem.open = (toggler.checked)));
        label.textContent = toggler.checked
          ? 'Collapse all'
          : 'Expand all';
      });

      if (window.location.hash) {
        const initialElem = document.querySelector(window.location.hash);
        if (initialElem) {
          initialElem.open = true;
        }
      }
    </script>
  </head>
  <body>
    <header>
      <img
        src="data:image/png;base64,"
        alt="Laura testing framework for Lua">
      <div>
        <h1>Laura Coverage Report</h1>
        <h2>Generated by Laura at $DATE$</h2>
        <h2>
          Average coverage&nbsp;<strong class="$AVGSTATUS$">$AVG$</strong> with $VERSION$
        </h2>
      </div>
    </header>
    <main>
      <label class="toggle-all">
        <input type="checkbox" id="toggle-button">
        <span id="toggle-label">Expand all</span>
      </label>
      $CONTENT$
    </main>
    <footer>
      <p>
        Generated by <a href="https://github.com/dknight/laura">Laura</a> at $DATE$.
      </p>
    </footer>
  </body>
</html>
]==]
